import React, { useState } from 'react';
import { registerApi } from '../apis/Api';
import { toast } from 'react-toastify';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Link from '@mui/material/Link';
import Paper from '@mui/material/Paper';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import Typography from '@mui/material/Typography';
import { createTheme, ThemeProvider } from '@mui/material/styles';

const Register = () => {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [phoneNo, setPhoneNo] = useState('');
  const [password, setPassword] = useState('');

  const changeFirstName = (e) => {
    setFirstName(e.target.value);
  };
  const changeLastName = (e) => {
    setLastName(e.target.value);
  };
  const changePhoneNo = (e) => {
    setPhoneNo(e.target.value);
  };
  const changePassword = (e) => {
    setPassword(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    console.log(firstName, lastName, phoneNo, password);

    const data = {
      firstName: firstName,
      lastName: lastName,
      phoneNo: phoneNo,
      password: password,
    };
    registerApi(data)
      .then((res) => {
        if (res.data.success === true) {
          toast.success(res.data.message);
        } else {
          toast.error(res.data.message);
        }
      })
      .catch((err) => {
        console.log(err);
        toast.error('Internal Server Error');
      });
  };
  const defaultTheme = createTheme();

  return (
    <ThemeProvider theme={defaultTheme}>
      <Box
        sx={{
          display: 'flex',
          height: '100vh',
        }}
      >
        <CssBaseline />
        <Box
          sx={{
            flex: 1,
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
          }}
        >
          <Box
            sx={{
              p: 4, // Add padding to the form
              width: '50%', // Set the width of the box
              border: '1px solid #ccc', // Add border
              borderRadius: '8px', // Add border radius
            }}
          >
            <Avatar sx={{ m: 1, bgcolor: 'secondary.main' }}>
              <LockOutlinedIcon />
            </Avatar>
            <Typography component="h1" variant="h5">
              Register
            </Typography>
            <Grid container spacing={2}>
              <Grid item xs={12} sm={6}>
                <TextField
                  margin="normal"
                  name="firstName"
                  required
                  fullWidth
                  label="First Name"
                  onChange={changeFirstName}
                />
              </Grid>
              <Grid item xs={12} sm={6}>
                <TextField
                  name="lastName"
                  margin="normal"
                  required
                  fullWidth
                  label="Last Name"
                  onChange={changeLastName}
                />
              </Grid>
              <Grid item xs={12}>
                <TextField
                  name="phoneNumber"
                  required
                  fullWidth
                  label="Phone number"
                  onChange={changePhoneNo}
                />
              </Grid>
              <Grid item xs={12}>
                <TextField
                  name="password"
                  required
                  fullWidth
                  label="Password"
                  onChange={changePassword}
                />
              </Grid>
              <Button
                type="submit"
                fullWidth
                variant="contained"
                sx={{
                  mt: 2,
                  mb: 2,
                  mx: 'auto',
                  width: '50%',
                  fontSize: 'medium',
                  color: 'black', // Text color
                  backgroundColor: 'grey', // Button color
                  '&:hover': {
                    backgroundColor: 'light-blue', // Button color on hover
                  },
                }}
              >
                Sign In
              </Button>
              <Grid container justifyContent="center">
                <Grid item xs={12} sx={{ textAlign: 'center', mt: 0.5, mb: 2 }}>
                  <span>
                    Already have an account?{' '}
                    <Link href="#" variant="body2" sx={{ textDecoration: 'underline' }}>
                      Log In
                    </Link>
                  </span>
                </Grid>
              </Grid>
            </Grid>
          </Box>
        </Box>
        <Box
          sx={{
            backgroundImage: 'url(https://forstpics.forestrynepal.org/1661673205318.jpg)',
            backgroundRepeat: 'no-repeat',
            backgroundColor: 'white', // Set background color to white
            backgroundSize: '50%', // Adjust the background size
            backgroundPosition: 'left', // Position the background image to the left
            flex: 1, // Take up the remaining space
          }}
        />
      </Box>
    </ThemeProvider>
  );
};

export default Register;
